筆リキッドとペンシルの２Way方式。
<br>
夜は眉の形作りのため、お風呂上りにリキッドで「眉を描く」。
<br>
そして朝は洗顔・メイク後にペンシルで眉を描く。
<br>
 お客様の最大の不満であった「朝、メイク後に使えない」という声にお答えして、ペンシル部分を付け加えました。
<br>
■リキッド
<br>
水、ジヒドロキシアセトン、BG、1,2-ヘキサンジオール、フェノキシエタノール、EDTA-2Na、ピロ亜硫酸Ｎa、アクリル酸アルキルコポリマーアンモニウム、スルホコハク酸ジエチルヘキシルNa、エタノール、ポリグルルタミン酸、オウゴンエキス、(+/-)、黄4、赤106、青1
<br>
■ペンシル
<br>
トリステアリン、ミツロウ、マイクロクリスタリンワックス、水添ヤシ油、トリ（カプリル酸/カプリン酸/ミリスチン酸/ステアリン酸）グリセリル、水添ヒマシ油、水添パーム核油、水添パーム油,(＋/－）酸化鉄、マイカ、酸化チタン、タルク、水酸化Ａｌ 
