■Ｋａｔｅ　Ｒｕｂｅｒレッグジムからトレーニングも美脚・身長UPも叶えるサンダル登場。<br>
■屋外も室内もOK！お出掛けに、オフィス履きに、ご近所履きに！<br>
<br>
≪足裏にぴったりとフィットする！≫<br>
●ヒールカップ<br>
カカトを優しく包み込み足をしっかりと支え、安定した歩行を導きます。<br>
●アーチサポート<br>
インソールと土踏まずの隙間をなくし足裏の縦アーチをサポートします。<br>
●中足骨サポート<br>
足裏を持ち上げ、横アーチのスプリング力をサポートします。<br>
●フィンガーバー<br>
足指の接地を高めます。<br>
●美脚約4.5cmヒール<br>
<br>
≪船底型ソールでトレーニング！≫<br>
前後に不安定なバランスを作る船底型のアウトソールでトレーニングシューズの機能をサンダルにプラス。<br>
さらに、ラウンドカットによりスムーズな歩行を可能にしました。<br>
美しい姿勢と適度な運動負荷により美脚・美姿勢へ導きます。<br>
アーチケアで足裏全体が使えてラクチン♪<br>
<br>
【こんな人におススメ！】<br>
・履き心地のいいサンダルは背や足が短く見えて困る…<br>
<br>
＜ケイトルーバーとは＞<br>
LAセレブの間で話題を呼んで、人気急上昇中の「ケイトルーバー」は、Surf Cityとして国際的に有名なハンティントンビーチで設立されたブランドです。<br>

甲材：合成皮革、インソール：ブラック／合成皮革、シルバー・ホワイト／ポリエステル、コルク部分：TPR、底材：合成底（EVA）<br>
